def bubbleDown(list: List[Int]): List[Int] =
  list match {
    case a :: b :: tail if a  b :: bubbleDown(a :: tail)
    case a :: b :: tail => a :: bubbleDown(b :: tail)
    case _ => list
  }

def bubbleSort(list: List[Int]): List[Int] =
